import React from 'react';
import * as actions from '../actions/auth';


export default  function Dashboard() {
    return <div>
        <h2>Dashboard</h2>
        <button onClick={getHomePage}>Click Me.</button>
    </div>;
}

const homePage = dispatch => {
    return {
      getHomePage: () => dispatch( actions.getHomePage() )
    };
  };
